import { Link } from "react-router-dom"

const Navigation = () =>
{
    return(
    <div id="nav">
<Link to="/" class="navbar" >Home</Link>
<Link to="/about" class="navbar">About</Link>
<Link to="/contact" class="navbar">About</Link>
<Routes>
      <Route path="/" element={<Home/>}></Route>
      </Routes>
    </div>
    );
}
export default Navigation;
